import React from 'react';
import styled from 'styled-components';

const SummonerSearchInput = styled.input`
  width: 800px;
  height: 55px;
  border-radius: 8px;
  border: none;
  font-family: 'Montserrat',
  font-size: 28;
  font-weight: 600;
`;

export default SummonerSearchInput;
